import axios from "axios";

const userLogIn = async (username: string, password: string) => {
    await axios.post("https://desktop-app-production.up.railway.app/login", {
        username,
        password
    })
        .then((res) => {
            return res;
        })
        .catch((err) => {
            console.error(err);
        })
}

export default userLogIn;
